window.bookSummaryJSON = "<p>Luke Skywalker's daring mission to halt the Yuuzhan Vong's nefarious plot to overthrow the New Republic is struggling on all fronts. And time is slipping away for Han and Leia Organa Solo, trapped on a small planet whose rulers are about to yield to Yuuzhan Vong pressure to give up the Jedi rebels.</p> <p>On Coruscant, Luke and Mara Jade Skywalker have made a shocking discovery that is preventing the Yuuzhan Vong from exerting complete control. But when the enemy tracks them down, Luke and Mara are thrust into a fierce battle for their lives. Suddenly, the chances of escaping appear nearly impossible. And in space, another battle rages, one that holds ominous consequences for the New Republic and for the Jedi themselves.</p>"; 
